function randomNumber(f){
    if(f == 0){
        return 0;
    }else{
        return Math.floor(Math.random() * (f - 0 + 1)) + 0;
    }
}
    
function importRandomImage(i){
    ranNum = randomNumber(i);               
    var thisFile = app.project.importFile(new ImportOptions(randomFiles[ranNum]));
    randomFiles.splice(ranNum,1);
    return thisFile
} 
 
